article_content:
나사 한개가 불량으로 와서 조여지지가 않네요;
밑에 다른 후기들보니 나사하나는 못보내준다고 하는것보니 걍 이렇게 써야할것같은데
배송 전에 똑바로좀 확인하고 보내세요;
후기들 보면서 피드백도 좀 받으시고요
2만원짜리에 뭘 기대하겠지만 2만원안에 나사 하나값도 다 포함된거 아닌가요?
다시는 안삽니다ㅋㅋ

이것만 여기서 총 3개를 샀는데 하나가 문제가있네요
나사가 돌리는 부분없이 막대? 부분만 있는채로 왔어요;;
나사 하나를 더 보내주시던지 하셔야할것같아요 ㅠㅠ 자꾸 기우네요

이쁘고 넓고 좋아요. 근데..별한개는 흔들바위 같아서 불안하지만
화분을 엄청 올렸는데도 별문제 없어요^^
아이가 있으신 분은 베란다나 세탁실에 사용하시는게 좋겠어요^^;;

이쁘기도하고 조립도 편하긴한데..
나사하나가 안들어가네요ㅡㅅㅡ;;
내가 잘못맞춘건가~하고 빼봣는데
제잘못이 아닌듯해여;;
나사 교체한다구 딱 맞게 들어갈일이 없을꺼같아
그냥쓸까해여~~~
